import React from 'react';
import Practice from './Practice';
import Sdata from './Sdata'

const All = () => {
    return (
        <div>
                {
                    Sdata.map((value) => {
                        return(
                            <Practice
                            key={value.id}
                            images={value.images}
                            category={value.category}
                            title={value.title}
                            links={value.links}

                              />
                        );
                    })
                }
        </div>

        
    )
}

export default All
